Create a sort of "tabular" projection using MongoDB aggregation<p>Let's say that I have the following documents in a one of the stages in mongodb aggregation:</p>

<pre><code>{
    type: "A",
    value: "A",
    index: 1
},
{
    type: "A",
    value: "B",
    index: 0
},
{
    type: "B",
    value: "a",
    index: 4
},
{
    type: "B"
    value: "b",
    index: 2
},
{
    type: "B",
    value: "c",
    index: 5
}
</code></pre>

<p>And I would like to process them using available aggregate stages (using syntax from Mongo 4.0) into:</p>

<pre><code>{
    type: "A",
    values: ["B", "A", null, null, null, null]
},
{
    type: "B",
    values: [null, null, "b", null, "a", "c"]
}
</code></pre>

<p>I was trying to use <code>$project</code> with <code>$reduce</code> but still I don't know how to set element at a specific index.</p>

<p>EDIT: The size of <code>values</code> array is not given up-front. In the sample case it's assumed to be 6 because the largest index is 5. So <code>values</code> in every output document has to be aligned to that size.</p>

