The dollar ($) prefixed field '$divide' in "weight.$divide" is not valid for storage<p>I've got the following update query in NodeJS with the underlying <code>mongodb</code> driver used by mongoose, 3.5.5, using the latest MongoDB server, 4.2.5 Community:</p>

<pre><code>    await mongoose.connection.db.collection('cluster1kms').updateOne({"location.coordinates": [point.longitude, point.latitude]}, {
                        $set: {
                            weight: {
                                $divide: [
                                    {
                                        $add: [
                                            {
                                                $multiply: ["$weight", "$count"]
                                            },
                                            point.weight
                                        ]
                                    },
                                    {
                                        $add: ["$count", 1]
                                    }
                                ]
                            }
                        },
                        $inc: {"count": 1}
                    }, {upsert: false});
</code></pre>

<p>As seen in the title, I keep getting the problem that <code>$divide</code> is not a valid storage name. MongoDB is supposed to allow aggregated pipelines in the updates, but I seem not to be having success with this. Tried the same also in the online MongoDB web shell, and the error is the same.</p>

<p>Am I missing anything?</p>

<p>Thanks</p>

