TypeError: Cannot create property '_id' on number '1' when trying to submit to MondoDB<p>My code finds a subreddit and returns 25 new comments in a JSON format. I then convert it to a string and splice it by its spaces while also removing special characters. I then generate a dictionary that counts the frequency of words in each comment. Then I send the dictionary to my db. </p>

<p>The problem is I want to break down the objects and have every word be an entry or merge all the objects into one and sum the frequency of any repeated keys.</p>

<p>Here is an attempt to iterate through the keys:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>function insertData() {
  let words = new Array();
  let commentlist = r.getSubreddit('').getNewComments();
  let cleanData = async() =&gt; {
    let result = await (commentlist);
    return result;
  };

  cleanData().then(function(result) {
    for (i = 0; i &lt;= result.length - 1; i++) {
      let currentData = JSON.stringify(result[i].body).split(' ');
      for (j = 0; j &lt;= currentData.length; j++) {
        if (currentData[j] != undefined) {
          words.push(currentData[j]);
        }
      }
    }
    for (i = 0; i &lt;= words.length - 1; i++) {
      words[i] = words[i].replace(/[?.,"'\/#!$%\^&amp;\*;:{}=\-_`~()]/g, "", '');
      words[i] = words[i].replace(/\s{2,}/g, " ");
      words[i] = words[i].replace(/[0-9]/g, " ");
    }

  }).then(() =&gt; {
    var wordsMap = {};
    words.forEach(function(key) {
      if (wordsMap.hasOwnProperty(key)) {
        wordsMap[key]++;
      } else {
        wordsMap[key] = 1;
      }
    });

    words = wordsMap;
    console.log(words);
    MongoClient.connect(process.env.MONGODB_URI || process.env.DB_CONNECTION, {
      useUnifiedTopology: true,
      useNewUrlParser: true
    }, function(err, db) {
      if (err) throw err;
      const dbo = db.db("d");
      const messageTable = dbo.collection("x");
      for (var key in words) {
        messageTable.insertOne(words[key], function(err, res) {
          if (err) throw err;
          console.log("documents inserted");
        });
      }
    })
  });

}</code></pre>
</div>
</div>
</p>

<p>But I get an error do to the last for loop even if I remove all numbers from my keys. The error is:</p>

<blockquote>
  <p>TypeError: Cannot create property '_id' on number '1'</p>
</blockquote>

<p>Now my question is would it be easier to merge the objects in my database and sort them by their frequency or separate them before or after inserting them into my database. How would I do this from where I am at?</p>

