/**</p>; Answer: If you want to run a subprocess asynchronously _and_ get a completion notification, use `NSTask`. Yes, the lack of blocks support in ASOC is famously annoying, but it's not insurmountable. The reason using `do shell script` with `&` doesn't return immediately is that the subprocess's stdout and stderr pipes are still connected to your process; however, if you redirect those then your process no longer receives any feedback. No doubt there are crazy ways you could kludge it, but you're just tying yourself in knots and potentially creating all sorts of nasty gotchas. Simpler just to use ObjC.

