Merging cells of a table populated with MongoDB collection data?<p>im currently using a <code>forEach</code> function to loop through my collection called <code>environments</code> to be displayed in an HTML table, but since there are multiple rows with the same version, how do i go about merging just those cells? I know i can use <code>rowspan</code> to merge cells, but my issues stems from using a <code>forEach</code>. using <code>rowspan</code> in a loop like that causes obvious issues, hence my question...</p>

<pre><code>&lt;table class="table"&gt;
  &lt;thead&gt;
    &lt;tr&gt;
      &lt;th scope="col"&gt;Version&lt;/th&gt;
      &lt;th scope="col"&gt;Region&lt;/th&gt;
      &lt;th scope="col"&gt;Contact Name&lt;/th&gt;
