        &lt;td&gt;
          &lt;%= environment.region %&gt;
        &lt;/td&gt;
        &lt;td&gt;
          &lt;%= environment.contact %&gt;
        &lt;/td&gt;
        &lt;td&gt;
          &lt;%= environment.date %&gt;
        &lt;/td&gt;
     &lt;% }); %&gt;
    &lt;/tr&gt;
